import Button from './Button';

const App = () => {
    const variable = true;

    if (variable) {
        return <p>Variable is true</p>
    }

    return (
        <div>
            <h1 onClick={(e) => console.log('click', e)}>
                Hello world!!
            </h1>
            <Button onClick={() => console.log('click')}>
                Send
            </Button>
        </div>
    );
};

export default App
